UnsupportedNamespace =Navneområdet "%S" understøttes ikke. Brug "http://www.mozilla.org/2002/soap/security".
UnknownRootElement =Rodelementet "%S" blev ikke genkendt. Brug "webScriptAccess" elementet.
UnknownElement =Elementet "%S" blev ikke genkendt.
UnknownAttribute =Attributen "%S" blev ikke genkendt.
TooManyElements =Der kan kun være et "%S" element.
ElementHasSibling =Elementet "%S" kan ikke have "%S" sideordnet.
ElementNotEmpty =Elementet "%S" må ikke være tomt.
SOAPFault =SOAP { %S } %S kaldet udløste fejlen: { %S } %S : %S.

